  false,\n\t\"url\": null,\n\t\"notes\": \"Northeast Cooperative Research Study Fleet
  (SF) Program partners with a subset of commercial fishermen to collect high quality,
  high resolution, haul by haul self-reported fishing data. SF staff routinely sails
  with program participants in order to collect independent catch weight measurements
  to compare to the Captainsu00e2u0080u0099 kept and discard records for verification.The
  SF Program creates a unique opportunity for the collection of biological data as
  well as biological samples both by vessel operators and by SF staff.  Participant
  vessels are able to provide biological data and fish to the NEFSC for use in research
  relevant to species stock assessments and a better understanding of fish biology.
  \ Commercial fishermen have the ability to provide samples during periods of time
  when traditional sample sources are unavailable (i.e., periods when NEFSC bottom
  trawl surveys are not operating, periods of species closures, specific needs with
  respect to species presence at certain times of the year and/or in specific locations,
  etc.) and they can also provide additional information with regards to their encountered
  catch (i.e., length frequencies, sex ratios, etc.).  \",\n\t\"license_title\": null,\n\t\"extras\":
